import React from 'react';
import './App.css';
import CurrencyCard from './CurrencyCard';

function App() {
  return (
    <div className="App">
        <div className="exchange">
          <div className="currencyType">
            <CurrencyCard title="Gemini" type="BTC"></CurrencyCard>
          </div>
          <div className="currencyType">
            <CurrencyCard title="Gemini" type="ETH"></CurrencyCard>
          </div>
      </div>
    </div>
  );
}

export default App;
